INSERT INTO `content` (`content_id`, `content_type`, `content_title_1`, `content_title_2`, `content_title_3`, `content_1`, `content_2`, `content_3`, `created_date`, `created_by`, `updated_date`, `updated_by`, `deleted`, `image_utama`, `image_convert`) VALUES
(1,	'0',	'“Water is a human right. To the extent one has the right to live, one has the right to water”',	'How did we start?',	'Our Partner',	'<p class=\"sexy\">RefillMyBottle is an online map that identifies all the places - be it a cafe, resort, museum or shop - where refillers could walk in and fill up their bottle with clean drinkable water for free or a minimum fee.</p>\n\n<p class=\"sexy\">We are a community of responsible travellers, conscious locals and mindful business owners who take action against plastic waste.</p>\n\n<p class=\"sexy\">We offer a simple alternative to buying bottled water and our goal is to reduce the number of single-use plastic bottles used unnecessarily throughout the world.</p>\n',	'<p class=\"sexy\">Our community was founded initially in Bali - an island that tourism has impacted in myriad ways. Over 6 million disposable plastic bottles are used and discarded every month in Bali alone.</p>\n\n<p class=\"sexy\">The lack of waste management systems means that these water bottles end up in landfills, the ocean, or are burned which creates toxic fumes. It&rsquo;s clear that the problem needs to be tackled at the source by reducing consumption of plastic water bottles.</p>\n\n<p class=\"sexy\">So, the question arises - without buying water out of a plastic bottle, how do we ensure access to clean drinking water for locals and tourists alike? A group of sustainable businesses in Bali came up with the simple idea of providing access to drinking water to all who need it - without having to buy a plastic water bottle. They created RefillMyBottle.</p>\n',	'<p>RefillMyBottle works with diverse business, nonprofits, and the other orgaisations to address plastic waste problems starting in indonesia. Our partners contribute more than financial support. Their time, manpower, support, ideas, and more helping build stronger community</p>\n\n<p>&nbsp;</p>\n',	'2018-10-30 05:09:36',	'1',	'2018-10-30 09:09:36',	'1',	'0',	'shutterstock-627323633.jpg',	'low_shutterstock-627323633.jpg');
