(2,	'Namaskara Coffee & Superfoods',	10,	'Namaskara_Voucher.jpg',	3,	'2019-03-31',	'<p>Vegetarian &amp; Vegan friendly cafe, using ingredients mostly from local &amp; organic farmers.</p>\n\n<p>Located at Jalan Tirta Tawar No. 50, Ubud.</p>\n',	'<p>1. Redeem your points to get voucher</p>\n\n<p>2. Check &#39;My Voucher&#39; on your profile on the app</p>\n\n<p>3. Show the voucher to the staff at Namaskara Coffee &amp; Superfood</p>\n\n<p>4. The friendly staff will click the &#39;use&#39; button for you.<em> (Note: once the &#39;use&#39; button is clicked, it will be off and no longer valid. Be careful not to click the button yourself). </em></p>\n',	'<p>10% discount valid for 1 (one) beverage only</p>\n\n<p>&nbsp;</p>\n',	'1',	1,	'2018-10-30 00:00:00',	'2018-10-30 08:32:20',	1),
